## This page redirects any non-admin user to his Homepage (Space.WebHome where Space = username)

#if( ! $hasAdmin )
 #set( $user = $stringtool.removeStart($xcontext.getUser(),'XWiki.') )
 $response.sendRedirect( $xwiki.getURL("${user}.WebHome") )
#end

{{/velocity}}

{{info}}
 Any non-admin user coming here will be redirected to a space of his name.
{{/info}}


