= How To prevent attachments from a page being purged ? =

{{warning}}
If the proper [[Scheduler job>>Scheduler.Attachments Cleaning]] is enabled, keep in mind that every attachment older than 2 months will be deleted from the wiki. To save the attachments, you only need to:
* Simply instantiate an object of class FTPCode.KeeperClass on the page you want to save. Attachments there won't be deleted.
{{/warning}}

